// ViewRegistration.js
import React, { useState, useEffect, useMemo } from 'react';

export default function ViewRegistration({ setNotificationMessage }) {
  const [companies, setCompanies] = useState([]);
  const [companyDetails, setCompanyDetails] = useState(null);
  const [searchQuery, setSearchQuery] = useState('');
  const [selectedIndustry, setSelectedIndustry] = useState('');
  const [industryOptions, setIndustryOptions] = useState([]);

  const loadPendingCompanies = () => {
    const all = JSON.parse(sessionStorage.getItem('companies')) || [];
    const pending = all.filter(c => !c.isAccepted);
    setCompanies(pending);
    setIndustryOptions([...new Set(pending.map(c => c.industry))]);
  };

  useEffect(() => {
    loadPendingCompanies();
  }, []);

  const filtered = useMemo(() => {
    return companies.filter(c =>
      c.companyName.toLowerCase().includes(searchQuery.toLowerCase()) &&
      (selectedIndustry ? c.industry === selectedIndustry : true)
    );
  }, [companies, searchQuery, selectedIndustry]);

  const handleAccept = () => {
    if (!companyDetails) return;
    const all = JSON.parse(sessionStorage.getItem('companies'));
    const updated = all.map(c =>
      c.companyEmail === companyDetails.companyEmail
        ? { ...c, isAccepted: true, hasNotification: true }
        : c
    );
    sessionStorage.setItem('companies', JSON.stringify(updated));
    setNotificationMessage(`Accepted: ${companyDetails.companyName}`);
    setCompanyDetails(null);
    loadPendingCompanies();
  };

  const handleReject = () => {
    if (!companyDetails) return;
    const all = JSON.parse(sessionStorage.getItem('companies'));
    const updated = all.filter(c => c.companyEmail !== companyDetails.companyEmail);
    sessionStorage.setItem('companies', JSON.stringify(updated));
    setNotificationMessage(`Rejected: ${companyDetails.companyName}`);
    setCompanyDetails(null);
    loadPendingCompanies();
  };

  const handleDownload = doc => {
    const a = document.createElement('a');
    a.href = doc.dataUrl;
    a.download = doc.name;
    a.click();
  };

  return (
    <div style={{ padding: 20 }}>
      <h1>Pending Company Registrations</h1>

      <div style={{ marginBottom: 16 }}>
        <input
          type="text"
          placeholder="Search name…"
          value={searchQuery}
          onChange={e => setSearchQuery(e.target.value)}
          style={{ padding: 6, width: 200, marginRight: 8 }}
        />
        <select
          value={selectedIndustry}
          onChange={e => setSelectedIndustry(e.target.value)}
          style={{ padding: 6 }}
        >
          <option value="">All Industries</option>
          {industryOptions.map((i, idx) => (
            <option key={idx} value={i}>{i}</option>
          ))}
        </select>
      </div>

      {filtered.length === 0 && <p>No pending registrations.</p>}
      {filtered.map(c => (
        <p key={c.companyEmail}>
          <button
            onClick={() => setCompanyDetails(c)}
            style={{
              background: 'none',
              border: 'none',
              padding: 0,
              color: 'blue',
              textDecoration: 'underline',
              cursor: 'pointer',
              display: 'inline-flex',
              alignItems: 'center'
            }}
          >
            {c.companyLogo && (
              <img
                src={c.companyLogo}
                alt=""
                style={{ width: 30, height: 30, borderRadius: '50%', marginRight: 8 }}
              />
            )}
            {c.companyName}
          </button>
        </p>
      ))}

      {companyDetails && (
        <div style={{
          position: 'fixed',
          top: 0, right: 0,
          width: 350, height: '100vh',
          background: '#f8f9fa',
          boxShadow: '-2px 0 5px rgba(0,0,0,0.2)',
          padding: 20,
          overflowY: 'auto'
        }}>
          <button
            onClick={() => setCompanyDetails(null)}
            style={{
              position: 'absolute', top: 10, right: 10,
              background: '#ccc', border: 'none', padding: 6, cursor: 'pointer'
            }}
          >
            Close
          </button>
          <div style={{ textAlign: 'center', marginBottom: 16 }}>
            <img
              src={companyDetails.companyLogo}
              alt=""
              style={{ width: 120, height: 120, borderRadius: '50%' }}
            />
            <h2>{companyDetails.companyName}</h2>
          </div>
          <p><strong>Industry:</strong> {companyDetails.industry}</p>
          <p><strong>Size:</strong> {companyDetails.companySize}</p>
          <p><strong>Email:</strong> {companyDetails.companyEmail}</p>

          {companyDetails.document && (
            <div style={{ margin: '20px 0', textAlign: 'center' }}>
              <button onClick={() => handleDownload(companyDetails.document)}>
                Download Document
              </button>
            </div>
          )}

          <div style={{ display: 'flex', justifyContent: 'space-around' }}>
            <button onClick={handleAccept}>Accept</button>
            <button onClick={handleReject}>Reject</button>
          </div>
        </div>
      )}
    </div>
  );
}
